XPEeAKHYyKCZI=\",\"commandMetadata\":{\"webCommandMetadata\":{\"url\":\"\/timedtext_video?ref=watch\\u0026v=LbH1ZDImaI8\",\"rootVe\":83769}},\"urlEndpoint\":{\"url\":\"\/timedtext_video?ref=watch\\u0026v=LbH1ZDImaI8\"}}}]},\"noSubtitlesText\":{\"simpleText\":\"This video doesn't have subtitles or closed captions yet.\"},\"promoSubtitlesText\":{\"simpleText\":\"Help this video reach more people by contributing subtitles or closed captions in a language you speak.\"}}}}},\"videoDetails\":{\"videoId\":\"LbH1ZDImaI8\",\"title\":\"Is SpaceX's Raptor engine the king of rocket engines?\",\"lengthSeconds\":\"2942\",\"keywords\":[\"Raptor engine\",\"SpaceX raptor engine\",\"SpaceX raptor engine review\",\"SpaceX raptor engine vs\",\"raptor engine vs merlin engine\",\"raptor engine vs be4\",\"staged combustion cycle\",\"rocket engine cycles\",\"methane rocket fuel vs rp1 vs hydrogen\",\"hydrolox vs methalox\",\"Spacex new rocket engine\",\"Elon musk new rocket\",\"elon musk raptor engine\",\"everyday astronaut raptor\",\"best rocket engine\",\"Starship engine\",\"open cycle vs closed cycle\",\"full flow staged combustion cycle\",\"starhopper\",\"why methalox\"],\"channelId\":\"UC6uKrU_WqJ1R2HMTY3LIx5Q\",\"isOwnerViewing\":false,\"shortDescription\":\"00:00 - Intro\\n02:55 - Basic physics of rocket engines \\n06:10 - Rocket engine cycles \\n20:30 - Rocket fuel comparison\\n30:40 - Raptor vs other rocket engines\\n44:05 - Summary\\n\\nArticle version - https:\/\/everydayastronaut.com\/?p=9823\\u0026preview=true\\n\\nSpaceX's new raptor engine is a methane fueled full flow staged combustion cycle engine and its so hard to develop, no engine like this has ever flown before! \\n\\nNow this topic can be really intimidating so in order to bring the Raptor engine into context, we’re going to do an overview of a few common types of rocket engine cycles then compare the Raptor to a few other common rocket engines, like SpaceX’s current work horse, the Merlin, The Space Shuttle’s RS-25, the RD-180, Blue Origin’s BE-4 and the F-1 engine.\\n\\nAnd if that’s not enough, not only is SpaceX using a crazy engine cycle, they’re also going to be using Liquid Methane as their fuel, again something that no orbital rocket has ever used! So we’ll also go over the unique characteristics of liquid methane as a rocket fuel and see if we can figure out why SpaceX went with Methane for the Raptor engine.\\n\\nWe'll also break down and explain all the different engine cycle types so you know what the full flow staged combustion cycle is, how it works, and how it compares to the other cycles.\\n\\nSo by the end of this video hopefully we’ll have the context to know why the raptor engine is special, how it compares to other rocket engines, why it’s using methane and hopefully find out if the Raptor engine will be the new king of rocket engines…\\n\\n-----------------------------------------------\\n\\nRocket engine renders by  @MartianDays https:\/\/twitter.com\/MartianDays\\n\\nF-1 Turbopump photo provided by Mike Jetzer\/heroicrelics.org\\n\\nHUGE thanks to my Moon Walker Patreon supporters! Blake Jacobs, Eli Burton, Jethro, Mac Malkawi, Neurostream, Ole Mathias Heggem\\n\\nWant to support what I do? Consider becoming a Patreon supporter for access to exclusive livestreams, our discord channel and subreddit! - http:\/\/patreon.com\/everydayastronaut\\n\\nThe best place for all your space merch needs!\\nhttps:\/\/everydayastronaut.com\/shop\/\\n\\nAll music is original! Check out my album \\\"Maximum Aerodynamic Pressure\\\" anywhere you listen to music (Spotify, iTunes, Google Play, Amazon, etc) or click here for easy links - http:\/\/everydayastronaut.com\/music\\n\\nI'm the cohost of an awesome podcast where we talk all about current technologies and how they shape our future! http:\/\/ourludicrousfuture.com or here on YouTube https:\/\/www.youtube.com\/ourludicrousfuture\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/  to share what was making me so excited. \\n\\nBut as someone who dropped out of college and has no technical background or degree… I really felt unqualified for the job of explaining rocket science to anyone. But the fact of the matter is, if I can learn this stuff, anyone can. \\n\\nRocket science is awesome, and you don’t need to be a rocket scientist to be excited. \\n\\nEveryday Astronaut. Bringing space down to Earth for everyday people.\"},\"callToAction\":{\"simpleText\":\"VISIT CHANNEL\"},\"dismiss\":{\"simpleText\":\"CANCEL\"},\"endpoint\":{\"clickTrackingParams\":\"CCcQ-N4BGAAiEwiir-bS7JLqAhXPEeAKHYyKCZIyDGl2LWVuZHNjcmVlbkiP0ZmRw6z92C0=\",\"commandMetadata\":{\"webCommandMetadata\":{\"url\":\"\/channel\/UC6uKrU_WqJ1R2HMTY3LIx5Q\",\"webPageType\":\"WEB_PAGE_TYPE_BROWSE\",\"rootVe\":3611}},\"browseEndpoint\":{\"browseId\":\"UC6uKrU_WqJ1R2HMTY3LIx5Q\"}},\"hovercardButton\":{\"subscribeButtonRenderer\":{\"buttonText\":{\"runs\":[{\"text\":\"SUBSCRIBE\"}]},\"subscribed\":false,\"enabled\":true,\"type\":\"FREE\",\"channelId\":\"UC6uKrU_WqJ1R2HMTY3LIx5Q\",\"showPreferences\":false,\"subscribedButtonText\":{\"runs\":[{\"text\":\"SUBSCRIBED\"}]},\"unsubscribedButtonText\":{\"runs\":[{\"text\":\"SUBSCRIBE\"}]},\"trackingParams\":\"CCgQmysiEwiir-bS7JLqAhXPEeAKHYyKCZIyDGl2LWVuZHNjcmVlbg==\",\"unsubscribeButtonText\":{\"runs\":[{\"text\":\"UNSUBSCRIBE\"}]},\"serviceEndpoints\":[{\"clickTrackingParams\":\"CCgQmysiEwiir-bS7JLqAhXPEeAKHYyKCZIyDGl2LWVuZHNjcmVlbg==\",\"commandMetadata\":{\"webCommandMetadata\":{\"url\":\"\/service_ajax\",\"sendPost\":true,\"apiUrl\":\"\/youtubei\/v1\/subscription\/subscribe\"}},\"subscribeEndpoint\":{\"channelIds\":[\"UC6uKrU_WqJ1R2HMTY3LIx5Q\"],\"params\":\"EgIIBBgA\"}},{\"clickTrackingParams\":\"CCgQmysiEwiir-bS7JLqAhXPEeAKHYyKCZI=\",\"commandMetadata\":{\"webCommandMetadata\":{\"url\":\"\/service_ajax\",\"sendPost\":true}},\"signalServiceEndpoint\":{\"signal\":\"CLIENT_SIGNAL\",\"actions\":[{\"clickTrackingParams\":\"CCgQmysiEwiir-bS7JL xt":"https://everydayastronaut.com/?p=9823...","navigationEndpoint":{"clickTrackingParams":"CJgBEM2rARgBIhMI57Hm0uyS6gIVVS7gCh2J3APXSI_RmZHDrP3YLQ==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=https%3A%2F%2Feverydayastronaut.com%2F%3Fp%3D9823%26preview%3Dtrue\u0026redir_token=revTgd9q5kKFR3wxcBTGqJKOT4J8MTU5MjgyNjg3N0AxNTkyNzQwNDc3\u0026event=video_description\u0026v=LbH1ZDImaI8","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=https%3A%2F%2Feverydayastronaut.com%2F%3Fp%3D9823%26preview%3Dtrue\u0026redir_token=revTgd9q5kKFR3wxcBTGqJKOT4J8MTU5MjgyNjg3N0AxNTkyNzQwNDc3\u0026event=video_description\u0026v=LbH1ZDImaI8","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nSpaceX's new raptor engine is a methane fueled full flow staged combustion cycle engine and its so hard to develop, no engine like this has ever flown before! \n\nNow this topic can be really intimidating so in order to bring the Raptor engine into context, we’re going to do an overview of a few common types of rocket engine cycles then compare the Raptor to a few other common rocket engines, like SpaceX’s current work horse, the Merlin, The Space Shuttle’s RS-25, the RD-180, Blue Origin’s BE-4 and the F-1 engine.\n\nAnd if that’s not enough, not only is SpaceX using a crazy engine cycle, they’re also going to be using Liquid Methane as their fuel, again something that no orbital rocket has ever used! So we’ll also go over the unique characteristics of liquid methane as a rocket fuel and see if we can figure out why SpaceX went with Methane for the Raptor engine.\n\nWe'll also break down and explain all the different engine cycle types so you know what the full flow staged combustion cycle is, how it works, and how it compares to the other cycles.\n\nSo by the end of this video hopefully we’ll have the context to know why the raptor engine is special, how it compares to other rocket engines, why it’s using methane and hopefully find out if the Raptor engine will be the new king of rocket engines…\n\n-----------------------------------------------\n\nRocket engine renders by  @MartianDays "},{"text":"https://twitter.com/MartianDays","navigationEndpoint":{"clickTrackingParams":"CJgBEM2rARgBIhMI57Hm0uyS6gIVVS7gCh2J3APXSI_RmZHDrP3YLQ==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=https%3A%2F%2Ftwitter.com%2FMartianDays\u0026redir_token=revTgd9q5kKFR3wxcBTGqJKOT4J8MTU5MjgyNjg3N0AxNTkyNzQwNDc3\u0026event=video_description\u0026v=LbH1ZDImaI8","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=https%3A%2F%2Ftwitter.com%2FMartianDays\u0026redir_token=revTgd9q5kKFR3wxcBTGqJKOT4J8MTU5MjgyNjg3N0AxNTkyNzQwNDc3\u0026event=video_description\u0026v=LbH1ZDImaI8","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nF-1 Turbopump photo provided by Mike Jetzer/heroicrelics.org\n\nHUGE thanks to my Moon Walker Patreon supporters! Blake Jacobs, Eli Burton, Jethro, Mac Malkawi, Neurostream, Ole Mathias Heggem\n\nWant to support what I do? Consider becoming a Patreon supporter for access to exclusive livestreams, our discord channel and subreddit! - "},{"text":"http://patreon.com/everydayastronaut","navigationEndpoint":{"clickTrackingParams":"CJgBEM2rARgBIhMI57Hm0uyS6gIVVS7gCh2J3APXSI_RmZHDrP3YLQ==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=http%3A%2F%2Fpatreon.com%2Feverydayastronaut\u0026redir_token=revTgd9q5kKFR3wxcBTGqJKOT4J8MTU5MjgyNjg3N0AxNTkyNzQwNDc3\u0026event=video_description\u0026v=LbH1ZDImaI8","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=http%3A%2F%2Fpatreon.com%2Feverydayastronaut\u0026redir_token=revTgd9q5kKFR3wxcBTGqJKOT4J8MTU5MjgyNjg3N0AxNTkyNzQwNDc3\u0026event=video_description\u0026v=LbH1ZDImaI8","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nThe best place for all your space merch needs!\n"},{"text":"https://everydayastronaut.com/shop/","navigationEndpoint":{"clickTrackingParams":"CJgBEM2rARgBIhMI57Hm0uyS6gIVVS7gCh2J3APXSI_RmZHDrP3YLQ==","commandMetadata":{"webCommandMetadata":{"url point":{"clickTrackingParams":"CAAQu2kiEwiir-bS7JLqAhXPEeAKHYyKCZI=","commandMetadata":{"webCommandMetadata":{"url":"/timedtext_video?ref=watch\u0026v=LbH1ZDImaI8","rootVe":83769}},"urlEndpoint":{"url":"/timedtext_video?ref=watch\u0026v=LbH1ZDImaI8"}}}]},"noSubtitlesText":{"simpleText":"This video doesn't have subtitles or closed captions yet."},"promoSubtitlesText":{"simpleText":"Help this video reach more people by contributing subtitles or closed captions in a language you speak."}}}}},"videoDetails":{"videoId":"LbH1ZDImaI8","title":"Is SpaceX's Raptor engine the king of rocket engines?","lengthSeconds":"2942","keywords":["Raptor engine","SpaceX raptor engine","SpaceX raptor engine review","SpaceX raptor engine vs","raptor engine vs merlin engine","raptor engine vs be4","staged combustion cycle","rocket engine cycles","methane rocket fuel vs rp1 vs hydrogen","hydrolox vs methalox","Spacex new rocket engine","Elon musk new rocket","elon musk raptor engine","everyday astronaut raptor","best rocket engine","Starship engine","open cycle vs closed cycle","full flow staged combustion cycle","starhopper","why methalox"],"channelId":"UC6uKrU_WqJ1R2HMTY3LIx5Q","isOwnerViewing":false,"shortDescription":"00:00 - Intro\n02:55 - Basic physics of rocket engines \n06:10 - Rocket engine cycles \n20:30 - Rocket fuel comparison\n30:40 - Raptor vs other rocket engines\n44:05 - Summary\n\nArticle version - https://everydayastronaut.com/?p=9823\u0026preview=true\n\nSpaceX's new raptor engine is a methane fueled full flow staged combustion cycle engine and its so hard to develop, no engine like this has ever flown before! \n\nNow this topic can be really intimidating so in order to bring the Raptor engine into context, we’re going to do an overview of a few common types of rocket engine cycles then compare the Raptor to a few other common rocket engines, like SpaceX’s current work horse, the Merlin, The Space Shuttle’s RS-25, the RD-180, Blue Origin’s BE-4 and the F-1 engine.\n\nAnd if that’s not enough, not only is SpaceX using a crazy engine cycle, they’re also going to be using Liquid Methane as their fuel, again something that no orbital rocket has ever used! So we’ll also go over the unique characteristics of liquid methane as a rocket fuel and see if we can figure out why SpaceX went with Methane for the Raptor engine.\n\nWe'll also break down and explain all the different engine cycle types so you know what the full flow staged combustion cycle is, how it works, and how it compares to the other cycles.\n\nSo by the end of this video hopefully we’ll have the context to know why the raptor engine is special, how it compares to other rocket engines, why it’s using methane and hopefully find out if the Raptor engine will be the new king of rocket engines…\n\n-----------------------------------------------\n\nRocket engine renders by  @MartianDays https://twitter.com/MartianDays\n\nF-1 Turbopump photo provided by Mike Jetzer/heroicrelics.org\n\nHUGE thanks to my Moon Walker Patreon supporters! Blake Jacobs, Eli Burton, Jethro, Mac Malkawi, Neurostream, Ole Mathias Heggem\n\nWant to support what I do? Consider becoming a Patreon supporter for access to exclusive livestreams, our discord channel and subreddit! - http://patreon.com/everydayastronaut\n\nThe best place for all your space merch needs!\nhttps://everydayastronaut.com/shop/\n\nAll music is original! Check out my album \"Maximum Aerodynamic Pressure\" anywhere you listen to music (Spotify, iTunes, Google Play, Amazon, etc) or click here for easy links - http://everydayastronaut.com/music\n\nI'm the cohost of an awesome podcast where we talk all about current technologies and how they shape our future! http://ourludicrousfuture.com or here on YouTube https://www.youtube.com/ourludicrousfuture","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/LbH1ZDImaI8/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLCIs034zZBAYpKKE9c5D w raptor engine is a methane fueled full flow staged combustion cycle engine and its so hard to develop, no engine like this has ever flown before! \n\nNow this topic can be really intimidating so in order to bring the Raptor engine into context, we’re going to do an overview of a few common types of rocket engine cycles then compare the Raptor to a few other common rocket engines, like SpaceX’s current work horse, the Merlin, The Space Shuttle’s RS-25, the RD-180, Blue Origin’s BE-4 and the F-1 engine.\n\nAnd if that’s not enough, not only is SpaceX using a crazy engine cycle, they’re also going to be using Liquid Methane as their fuel, again something that no orbital rocket has ever used! So we’ll also go over the unique characteristics of liquid methane as a rocket fuel and see if we can figure out why SpaceX went with Methane for the Raptor engine.\n\nWe'll also break down and explain all the different engine cycle types so you know what the full flow staged combustion cycle is, how it works, and how it compares to the other cycles.\n\nSo by the end of this video hopefully we’ll have the context to know why the raptor engine is special, how it compares to other rocket engines, why it’s using methane and hopefully find out if the Raptor engine will be the new king of rocket engines…\n\n-----------------------------------------------\n\nRocket engine renders by  @MartianDays https://twitter.com/MartianDays\n\nF-1 Turbopump photo provided by Mike Jetzer/heroicrelics.org\n\nHUGE thanks to my Moon Walker Patreon supporters! Blake Jacobs, Eli Burton, Jethro, Mac Malkawi, Neurostream, Ole Mathias Heggem\n\nWant to support what I do? Consider becoming a Patreon supporter for access to exclusive livestreams, our discord channel and subreddit! - http://patreon.com/everydayastronaut\n\nThe best place for all your space merch needs!\nhttps://everydayastronaut.com/shop/\n\nAll music is original! Check out my album \"Maximum Aerodynamic Pressure\" anywhere you listen to music
